/**
 * calculate conflicts and safe depending features in array
 * @param {page} feature 
 * @returns {array}
 */
function getCalculatedConflicts (feature) {
 let conflictPages = [];

 let plannedStart = feature.get(FEATURE.ATTR.PLANNED_START)
 //stop if plannedStart of feature is empty -> no calculation possible
 if (plannedStart === null) {
 return conflictPages;
 }

 // When the feature is already done, there is no conflict
 let state = feature.get(FEATURE.ATTR.STATUS);
 if (state && state === FEATURE.ENUM_STATUS_STATE.DONE) {
 return conflictPages;
 }
 let predecessors = feature.get(FEATURE.ATTR.DEPENDS_ON);
 cplace.each (predecessors, function (predecessor) {
 let predecessorPlannedEnd = predecessor.get(FEATURE.ATTR.PLANNED_END);
 //dateconflict if predecessor has no plannedEnd 
 if (predecessorPlannedEnd === null) {
 conflictPages.push(predecessor)
 } else 
 //dateconflict if plannedEnd of predecessor is after plannedStart of Feature
 if (predecessorPlannedEnd.withTimeAtStartOfDay().isAfter(plannedStart.withTimeAtStartOfDay())) {
 conflictPages.push(predecessor)
 }

 })
 return conflictPages
}





/**
 * not in use
 * update conflict status if changed
 * @param {page} feature 
 * @param {String} conflictState 
 */
function updateConflictState (feature, conflictState) {
 if (conflictState !== feature.get(FEATURE.ATTR.CONFLICT_STATE)) {
 let customAttributes = {};
 customAttributes[FEATURE.ATTR.CONFLICT_STATE] = conflictState;
 updatePage(feature, customAttributes);
 }
}


/**
 * not in use
 * check if conflicts exist for given feature
 * @param {page} feature 
 * @returns boolean
 */
function getConflictState(feature) {
 let conflictState = FEATURE.ENUM_CONFLICT_STATE.NO_CONFLICTS;

 let plannedStart = feature.get(FEATURE.ATTR.PLANNED_START)
 //stop if plannedStart of feature is empty -> no calculation possible
 if (plannedStart === null) {
 return conflictState;
 }

 let predecessors = feature.get(FEATURE.ATTR.DEPENDS_ON);
 cplace.each (predecessors, function (predecessor) {
 let predecessorPlannedEnd = predecessor.get(FEATURE.ATTR.PLANNED_END);
 //dateconflict if predecessor has no plannedEnd 
 if (predecessorPlannedEnd === null) {
 conflictState = FEATURE.ENUM_CONFLICT_STATE.CONFLICT;
 return
 }

 //dateconflict if plannedEnd of predecessor is after plannedStart of Feature
 if (predecessorPlannedEnd.withTimeAtStartOfDay().isAfter(plannedStart.withTimeAtStartOfDay())) {
 conflictState = FEATURE.ENUM_CONFLICT_STATE.CONFLICT;
 return;
 }

 })

 return conflictState;
}





